import React from 'react';
import AddTask from './AddTask';
import TasksList from './TasksList';

class TasksManagement extends React.Component {

  render() {
    return (
      <div className="container mt-4">
      <div className="row">
        <div className="col-6"><AddTask></AddTask></div>
        <div className="col-6"><TasksList></TasksList></div>
      </div>
      </div>
    );
  }
}

export default TasksManagement;
